import React from 'react';
import { MDBInput,MDBFormInline } from 'mdbreact';

class Footer extends React.Component {
    render() {

        return (
            <div>
      {/* Material inline */}
      <div>
      {/* Material unchecked */}
      <MDBInput label="Filled-in unchecked" type="checkbox" id="checkbox1" />

      {/* Material checked */}
      <MDBInput label="Filled-in unchecked" checked type="checkbox" id="checkbox2" />

      {/* Material unchecked disabled */}
      <MDBInput label="Filled-in unchecked" disabled type="checkbox" id="checkbox3" />

      {/* Material checked disabled */}
      <MDBInput label="Filled-in unchecked" checked disabled type="checkbox" id="checkbox4" />
    </div>
      <div>
      {/* Filled-in unchecked */}
      <MDBInput label="Filled-in unchecked" filled type="checkbox" id="checkbox1" />

      {/* Filled-in checked */}
      <MDBInput label="Filled-in unchecked" filled checked type="checkbox" id="checkbox2" />

      {/* Filled-in unchecked disabled */}
      <MDBInput label="Filled-in unchecked" filled disabled type="checkbox" id="checkbox3" />

      {/* Filled-in checked disabled */}
      <MDBInput label="Filled-in unchecked" filled checked disabled type="checkbox" id="checkbox4" />
    </div>
    </div>
        )
    }
}


export default Footer
